function convertNsfToUge(nsf_file){
    let current_pattern = -1
    const nsf_rows = nsf_file.split('\n').reduce((rows, row) => {
        if (row.startsWith("PATTERN")) {
            current_pattern++;
            rows[current_pattern]=[]
        }
        if (row.startsWith("ROW")) {
            rows[current_pattern].push(row)
        }
        return rows
    }, [])
    
    const patterns = nsf_rows.map((row)=>{
        return row.map((cell)=>{
            let sub_patterns = cell.split(":")
            sub_patterns.shift()
            sub_patterns = sub_patterns.map((s_p)=>s_p.trim())

            return sub_patterns.map((sub_pattern)=>{
                const sub_cells = sub_pattern.split(" ").map((s_p)=>s_p.trim())
                return{
                    note: sub_cells[0],
                    instrument: sub_cells[1],
                    effect_code: sub_cells[2],
                    effect_param: sub_cells[3]
                }
            })

        })
    })

    return patterns
}

